def enable_virtual_terminal():
    """启用Windows虚拟终端模式"""
    h_stdout = GetStdHandle(STD_OUTPUT_HANDLE)
    if h_stdout == INVALID_HANDLE_VALUE:
        return False
    mode = wintypes.DWORD()
    if not kernel32.GetConsoleMode(h_stdout, ctypes.byref(mode)):
        return False
    mode.value |= ENABLE_VIRTUAL_TERMINAL_PROCESSING
    return SetConsoleMode(h_stdout, mode)

def print_colorful(text, color):
    """打印彩色文本"""
    print(f"{color}{text}{COLOR_RESET}")

def get_current_time():
    """获取当前UTC时间"""
    return datetime.now(UTC).strftime("%Y-%m-%d %H:%M:%S UTC")

def sync_directory_timestamps(src_dir, dest_dir):
    """同步源目录和目标目录的时间戳"""
    try:
        # 获取源目录的时间戳
        h_src_dir = CreateFile(
            src_dir, 128 | 32, FILE_SHARE_READ | FILE_SHARE_WRITE,
            None, OPEN_EXISTING, FILE_FLAG_BACKUP_SEMANTICS, None
        )
        if h_src_dir == INVALID_HANDLE_VALUE:
            raise ctypes.WinError(ctypes.get_last_error())

        creation_time = wintypes.FILETIME()
        last_access_time = wintypes.FILETIME()
        last_write_time = wintypes.FILETIME()
        if not GetFileTime(h_src_dir, ctypes.byref(creation_time), ctypes.byref(last_access_time), ctypes.byref(last_write_time)):
            CloseHandle(h_src_dir)
            raise ctypes.WinError(ctypes.get_last_error())
        CloseHandle(h_src_dir)

        # 设置目标目录的时间戳
        h_dest_dir = CreateFile(
            dest_dir, GENERIC_WRITE, 0, None, OPEN_EXISTING, FILE_FLAG_BACKUP_SEMANTICS, None
        )
        if h_dest_dir == INVALID_HANDLE_VALUE:
            raise ctypes.WinError(ctypes.get_last_error())
        SetFileTime(h_dest_dir, ctypes.byref(creation_time), ctypes.byref(last_access_time), ctypes.byref(last_write_time))
        CloseHandle(h_dest_dir)
    except Exception as e:
        print_colorful(f"Error syncing timestamps for {dest_dir}: {e}", COLOR_RED)

import shutil  # 用于删除目录

def calculate_sha1(file_path):
    """计算文件的 SHA1 校验值"""
    sha1 = hashlib.sha1()
    with open(file_path, 'rb') as f:
        while chunk := f.read(BUFFER_SIZE):
            sha1.update(chunk)
    return sha1.hexdigest()

def copy_file(src_path, dest_path, root_dir):
    """逐字节复制文件并显示进度"""
    # 打开源文件
    h_src = CreateFile(
        src_path, 0x80, FILE_SHARE_READ | FILE_SHARE_WRITE,
        None, OPEN_EXISTING, FILE_ATTRIBUTE_NORMAL, None
    )
    if h_src == INVALID_HANDLE_VALUE:
        raise ctypes.WinError(ctypes.get_last_error())

    # 获取文件大小
    file_size = GetFileSize(h_src, None)
    if file_size == 0xFFFFFFFF:
        CloseHandle(h_src)
        raise ctypes.WinError(ctypes.get_last_error())

    # 获取源文件的时间戳
    creation_time = wintypes.FILETIME()
    last_access_time = wintypes.FILETIME()
    last_write_time = wintypes.FILETIME()
    if not GetFileTime(h_src, ctypes.byref(creation_time), ctypes.byref(last_access_time), ctypes.byref(last_write_time)):
        CloseHandle(h_src)
        raise ctypes.WinError(ctypes.get_last_error())
    CloseHandle(h_src)

    global CopyFastly
    ret = CopyFastly(src_path, dest_path, "{percentage}%    " + os.path.relpath(src_path, root_dir) + "\r")

    # 设置目标文件的时间戳
    h_dest = CreateFile(
        dest_path, 0x100, 0, None, OPEN_EXISTING, FILE_ATTRIBUTE_NORMAL, None
    )
    if h_dest == INVALID_HANDLE_VALUE:
        CloseHandle(h_src)
        raise ctypes.WinError(ctypes.get_last_error())
    SetFileTime(h_dest, ctypes.byref(creation_time), ctypes.byref(last_access_time), ctypes.byref(last_write_time))
    CloseHandle(h_dest)
    CloseHandle(h_src)
    print()  # 换行
    return ret

def copy_directory(src_dir, dest_dir, total_files=0, failed_files=0, root_dir=0):
    """递归复制目录，并统计复制的文件和失败的文件"""
    # 创建目标目录
    try:
        if not os.path.exists(dest_dir):
            os.makedirs(dest_dir)
    except Exception as e:
        print_colorful(f"Error creating directory {dest_dir}: {e}", COLOR_RED)
        failed_files += 1
        return total_files, failed_files
    
    if not root_dir:
        root_dir = src_dir

    # 遍历源目录中的内容
    for item in os.listdir(src_dir):
        src_item = os.path.join(src_dir, item)
        dest_item = os.path.join(dest_dir, item)

        if os.path.isdir(src_item):
            # 如果是目录，递归调用 copy_directory
            total_files, failed_files = copy_directory(src_item, dest_item, total_files, failed_files, root_dir)
        else:
            # 如果是文件，复制文件
            total_files += 1
            try:
                ret = copy_file(src_item, dest_item, root_dir)
                if not ret:
                    raise Exception(f"CopyFastly.dll has returned {ret} ({ctypes.WinError(ctypes.get_last_error())})")
            except Exception as e:
                failed_files += 1
                print_colorful(f"Error copying {src_item}: {e}", COLOR_RED)

    # 同步目录的时间戳
    sync_directory_timestamps(src_dir, dest_dir)

    return total_files, failed_files

def main(CopyFastly_Location, args_source, args_destination):
    try:
        # 启用虚拟终端模式
        if not enable_virtual_terminal():
            print_colorful("Warning: Failed to enable virtual terminal mode.", COLOR_RED)


        # 用户输入源路径和目标路径
        src_dir = args_source or input("Enter source directory: ").strip()
        dest_dir = args_destination or input("Enter destination directory: ").strip()

        if not (os.path.isdir(src_dir) or os.path.isfile(src_dir)):
            print_colorful(f"Error: Source directory '{src_dir}' does not exist.", COLOR_RED)
            return

        # 显示操作开始时间 
        print_colorful(f"Current Time: {get_current_time()}", COLOR_GREEN)
        print_colorful(f"{COLOR_LIGHTBLUE}File operation has started.", COLOR_BLUE)

        # 开始计时
        start_time = time.time()

        print(f"\033[90mSource      is {COLOR_DARKBLUE}{src_dir}{COLOR_RESET}\033[90m.\nDestination is {COLOR_DARKBLUE}{dest_dir}{COLOR_RESET}\033[90m.{COLOR_RESET}")

        print("Loading CopyFastly.dll", end="\r")
        global CopyFastly
        #CFHandle = ctypes.WinDLL('kernel32.dll').LoadLibraryW(CopyFastly_Location)
        CopyFastly = ctypes.WinDLL(CopyFastly_Location).CopyFastly#(ctypes.WinDLL('kernel32.dll').GetProcAddress(CFHandle, (ctypes.c_ubyte * 11)(0x43, 0x6f, 0x70, 0x79, 0x46, 0x61, 0x73, 0x74, 0x6c, 0x79, 0x00)))
        CopyFastly.argtypes = (
            ctypes.c_wchar_p,  # 第一个参数 (PCWSTR srcFile)
            ctypes.c_wchar_p,   # 第二个参数 (PCWSTR destFile)
            ctypes.c_wchar_p   # 第3个参数 (PCWSTR)
        )
        CopyFastly.restype = ctypes.c_bool
        if not CopyFastly:
            print(f"{COLOR_RED}Cannot load CopyFastly.dll where is {CopyFastly_Location}{COLOR_RESET}")
            raise Exception()
        print(f"{COLOR_BLUE}CopyFastly.dll has successfully loaded.{COLOR_RESET}")

        print()

        try:
            # 判断输入类型并调用合适的复制函数
            if os.path.isfile(src_dir):
                # 如果是文件，调用 copy_file
                # print_colorful(f"Copying file: {src_dir} -> {dest_dir}", COLOR_BLUE)
                src_parent_dir = os.path.dirname(src_dir)  # 获取源文件的上层目录
                result = copy_file(src_dir, dest_dir, src_parent_dir)
                total_files = 1
                failed_files = 0 if result else 1
                if not result:
                    print_colorful(f"Error: CopyFastly.dll has returned {result} ({ctypes.WinError(ctypes.get_last_error())})", COLOR_RED)
            elif os.path.isdir(src_dir):
                # 如果是目录，调用 copy_directory
                total_files, failed_files = copy_directory(src_dir, dest_dir)
            else:
                print_colorful(f"Error: Source path '{src_dir}' is neither a file nor a directory.", COLOR_RED)

            # 结束计时
            end_time = time.time()
            elapsed_time = end_time - start_time

            # 显示操作完成时间
            print()
            print_colorful(f"Current Time: {get_current_time()}", COLOR_GREEN)
            print_colorful(f"{COLOR_LIGHTBLUE}File operation has completed.", COLOR_BLUE)
            print_colorful(f"{total_files} files proceeded, {failed_files} fails.", COLOR_BLUE)
            print_colorful(f"Elapsed Time: {elapsed_time:.2f} seconds", COLOR_BLUE)

            # 如果没有错误，询问用户是否进行 SHA1 校验
            if failed_files == 0:
                sha1_check = input("Do you want to perform SHA1 checksum verification? [y/N]: ").strip().lower()
                if sha1_check == 'y':
                    print(f"{COLOR_BLUE}SHA1 checksum verification in progress...{COLOR_RESET}")
                    verification_failed = False

                    if os.path.isfile(src_dir):
                        src_file = src_dir
                        dest_file = dest_dir
                        src_sha1 = calculate_sha1(src_file)
                        dest_sha1 = calculate_sha1(dest_file)

                        if src_sha1 != dest_sha1:
                            print_colorful(f"\nChecksum mismatch: \n    {src_file}={src_sha1}\n    {dest_file}={dest_sha1}", COLOR_RED)
                            verification_failed = True
                        else:
                            print(f"{COLOR_GREEN}Checksum verified: {src_sha1}|{src_file}{COLOR_RESET}", end="\r")
                    else:
                        # 遍历源目录和目标目录，逐文件校验
                        for root, _, files in os.walk(src_dir):
                            relative_path = os.path.relpath(root, src_dir)
                            dest_root = os.path.join(dest_dir, relative_path)

                            for file_name in files:
                                src_file = os.path.join(root, file_name)
                                dest_file = os.path.join(dest_root, file_name)

                                # 计算源文件和目标文件的 SHA1
                                src_sha1 = calculate_sha1(src_file)
                                dest_sha1 = calculate_sha1(dest_file)

                                if src_sha1 != dest_sha1:
                                    print_colorful(f"\nChecksum mismatch: \n    {src_file}={src_sha1}\n    {dest_file}={dest_sha1}", COLOR_RED)
                                    verification_failed = True
                                else:
                                    print(f"{COLOR_GREEN}√ {src_sha1} {relative_path + os.path.sep + file_name}    {COLOR_RESET}", end="\r")

                    if not verification_failed:
                        print_colorful("\nAll files passed SHA1 checksum verification.", COLOR_GREEN)
                    else:
                        print_colorful("\nVerification failed.", COLOR_RED)

        except KeyboardInterrupt:
            # 捕获 Ctrl-C，询问用户是否需要回滚
            print_colorful("\nOperation was interrupted by the user.", COLOR_RED)
            rollback = input("Rollback? [y/N]: ").strip().lower()
            if rollback == 'y':
                print(f"{COLOR_BLUE}Rollback in progress...", end="\r")
                try:
                    if os.path.isfile(dest_dir):
                        if not ctypes.WinDLL('kernel32.dll').DeleteFileW(dest_dir):
                            raise ctypes.WinError(ctypes.get_last_error())
                    else:
                        shutil.rmtree(dest_dir)  # 删除目标目录
                    print_colorful(f"Rollback completed: '{dest_dir}' has been deleted.", COLOR_GREEN)
                except Exception as e:
                    print_colorful(f"Error during rollback: {e}", COLOR_RED)
            else:
                print_colorful("Rollback skipped. Destination directory remains intact.", COLOR_BLUE)

        except BaseException as e:
            # 捕获其他所有异常
            print_colorful(f"\nUnknown error occurred: {e}", COLOR_RED)
            print_colorful("Please check the input and try again.", COLOR_RED)

        finally:
            ## 释放DLL
            ##ctypes.WinDLL('kernel32.dll').FreeLibrary(CFHandle)
            ##ctypes.WinDLL('kernel32.dll').DeleteFileW(CopyFastly_Location)
            # 我们将在上层进程中处理此操作
            pass

    except BaseException as e:
        # 捕获所有异常（包括外层异常）
        print_colorful(f"\nUnexpected error occurred: {e}", COLOR_RED)

    input("Press Enter to continue... ")

def main2():
    parser = argparse.ArgumentParser(description="Copy File or Directory without EFS (with 128MiB of cache (double)) (Fast)")
    parser.add_argument("-main", action="store_true", help="Run As Main Module")
    parser.add_argument("--copy-fastly-location", type=str, help="Specify the location of CopyFastly.dll")
    parser.add_argument("-s", "--source", dest="source", type=str, help="Source")
    parser.add_argument("-d", "--destination", dest="destination", type=str, help="Destination")
    args, unknown = parser.parse_known_args()

    if not args.main:
        CopyFastly_Location = os.path.abspath(get_copyfastly_dll())
        enable_virtual_terminal()
        # 如果没有以 -main 参数运行，则创建子进程
        try:
            # 构建子进程的命令行参数
            subprocess_args = [sys.executable, __file__, "-main", f"--copy-fastly-location={CopyFastly_Location}"]
            # 将未知参数添加到子进程参数列表中
            subprocess_args.extend(unknown)
            # 自动转发所有已知参数（除了 -main）
            for arg_name, arg_value in vars(args).items():
                if arg_value is not None and arg_name != "main":  # 排除 -main
                    subprocess_args.append(f"--{arg_name.replace('_', '-')}={arg_value}")
            # 运行子进程
            subprocess.run(subprocess_args)
        except BaseException as e:
            print(f"{COLOR_DARKBLUE}[INFO]  Ignoring exceptions from sub process.{COLOR_RESET}")
        # 子进程结束后执行清理
        print(f"{COLOR_DARKBLUE}[INFO]  Attempting to remove file {CopyFastly_Location}{COLOR_RESET}")
        if not ctypes.WinDLL('kernel32.dll').DeleteFileW(CopyFastly_Location):
            print(f"\033[33m[WARN]  Cannot remove temporary file {CopyFastly_Location}{COLOR_RESET}")
    else:
        # 如果以 -main 参数运行，则执行主程序
        main(args.copy_fastly_location, args.source, args.destination)


